<?php

namespace App\Controller\Api;

use Imagine\Image\Box;
use Imagine\Image\ImageInterface;
use Imagine\Imagick\Imagine;
use ProxyManager\ProxyGenerator\PropertyGenerator\PublicPropertiesMap;
use Symfony\Component\Routing\Annotation\Route;
use Symfony\Bundle\FrameworkBundle\Controller\AbstractController;
use Symfony\Component\DependencyInjection\ParameterBag\ParameterBagInterface;

class ImageController extends AbstractController
{
    /**
     * Test de base64
     * @Route("api/v1/base64", name="api_base64", methods={"POST"})
     * @return void
     */
    public function ConvertBase64(ParameterBagInterface $bag, $imageBase64, $picture)
    {

        // on récupère l'image en base64
        // $pasUtilisé = "data:image/jpeg;base64,";

        // $picture = "test-image.jpg";

        // Vérifier si des données data ont été reçues
        if (!empty($imageBase64)) {

            // Extraire le contenu base64 de l'image
            $base64 = explode(',', $imageBase64);
            $metaData = $base64[0];
            $isBase64 = explode(';', $metaData);

            // Récupérer le type de l'image
            $typeexp = explode('/', $metaData);

            // Vérifier si les métadonnées sont en base64
            if ($isBase64[1] === 'base64') {
                // Convertir le base64 en fichier image
                $image = base64_decode($base64[1]);

                // Chemin absolu du dossier "public"
                $publicPath = $bag->get('image_path');

                // Définir le nom du fichier ici
                $fileName = $picture;

                // Sauvegarder l'image dans le dossier
                if(file_put_contents($publicPath . $fileName, $image, FILE_APPEND | LOCK_EX) !== false) {
                    $imagine = new Imagine();

                    // Ouvrir l'image d'origine
                    $image2 = $imagine->open($publicPath . $fileName);

                    // Obtenir les dimensions de l'image
                    $imageSize = $image2->getSize();
                    $width = $imageSize->getWidth();
                    $height = $imageSize->getHeight();

                    // Calculer la taille de côté minimale pour créer un carré
                    $minSide = min($width, $height);

                    // Créer un carré en redimensionnant l'image
                    $squareImage = $image2->thumbnail(new Box($minSide, $minSide), ImageInterface::THUMBNAIL_OUTBOUND);

                    // Sauvegarder l'image redimensionnée
                    // $squareImage->save($publicPath);

                    // je nomme l'image carré
                    $newFileName = 'carré_' . $fileName;

                    // Sauvegarder l'image carrée dans le dossier
                    if(file_put_contents($publicPath . $newFileName, $squareImage, FILE_APPEND | LOCK_EX) !== false) {
                        // Ouvrir l'image carrée
                        $image = $imagine->open($publicPath . $fileName);

                        // Redimensionner l'image en petit format (400x400)
                        $smallSize = new Box(400, 400);
                        $smallImage = $image->thumbnail($smallSize, 'outbound');
                        $nameSmallImage = 'small_' . $fileName;

                        if(file_put_contents($publicPath . $nameSmallImage, $smallImage, FILE_APPEND | LOCK_EX) !== false) {
                            return true;
                        } else {
                            return $this->json(['erreur lors de l\'enregistrement de la petite image'], 400);
                        }

                    } else {
                        return $this->json(['erreur lors de l\'enregistrement de l\image carré.'], 400);
                    }

                } else {
                    return $this->json(['erreur lors de l\'enregistrement de l\image d\'origine.'], 400);
                }

            } else {
                return $this->json(['le format de l\'image n\'est pas le bon'], 400);
            }
        }
    }
    /**
     * Redim d'une image avec PHP GD
     *
     * PHP GD
     * @Route("api/v1/GD", name="api_GD", methods={"POST"})
     * @return void
     */
    public function resizeImageWithGD(ParameterBagInterface $bag, $imageBase64, $picture)
    {
        // on récupère l'image en base64
        $imageBase64d = "data:image/jpeg;base64,";

        // $picture = "test-image.jpg";

        // Vérifier si des données data ont été reçues
        if (!empty($imageBase64)) {

            // Extraire le contenu base64 de l'image
            $base64 = explode(',', $imageBase64);
            $metaData = $base64[0];
            $isBase64 = explode(';', $metaData);

            // Récupérer le type de l'image
            $typeexp = explode('/', $metaData);

            // Vérifier si les métadonnées sont en base64
            if ($isBase64[1] === 'base64') {
                // Convertir le base64 en fichier image
                $image = base64_decode($base64[1]);

                // Chemin absolu du dossier "public"
                $publicPath = $bag->get('image_path');

                // Définir le nom du fichier ici
                $fileName = $picture;

                $imageRessource = imagecreatefromstring($image);

                if ($imageRessource !== false) {
                    // Obtenir la largeur et la hauteur de l'image
                    $width = imagesx($imageRessource);
                    $height = imagesy($imageRessource);

                } else {
                    return $this->json(['Impossible de créer l\'image à partir de la chaîne base64.'], 400);
                }

                // je prend le côté le plus court
                $side = min($width, $height);

                // Créez une nouvelle image carrée vide
                $squareImage = imagecreatetruecolor($side, $side);

                // je copie l'image d'origine dans la nouvelle image carrée
                imagecopyresampled(
                    $squareImage,           // Image de destination (carrée)
                    $imageRessource,         // Image source (originale)
                    0,                      // Coordonnée X de destination pour la copie
                    0,                      // Coordonnée Y de destination pour la copie
                    ($width - $side) / 2,                      // Coordonnée X de la source pour la copie
                    ($height - $side) / 2,                      // Coordonnée Y de la source pour la copie
                    $side,                  // Nouvelle largeur
                    $side,                  // Nouvelle hauteur
                    $side,                 // Largeur d'origine
                    $side                 // Hauteur d'origine
                );

                // Sauvegarde la nouvelle image carrée au format JPEG 
                imagejpeg($squareImage, $publicPath . $fileName);

                // maintenant, je crée la petite image en format 400x400
                $image400x400 = imagecreatetruecolor(400, 400);

                // Redimensionner l'image carrée vers une taille de 400x400 pixels
                imagecopyresampled(
                    $image400x400,           // Image de destination (400x400)
                    $squareImage,            // Image source (carrée)
                    0,                       // Coordonnée X de destination pour la copie
                    0,                       // Coordonnée Y de destination pour la copie
                    0,                       // Coordonnée X de la source pour la copie
                    0,                       // Coordonnée Y de la source pour la copie
                    400,                     // Nouvelle largeur (400 pixels)
                    400,                     // Nouvelle hauteur (400 pixels)
                    $side,                   // Largeur d'origine (carrée)
                    $side                    // Hauteur d'origine (carrée)
                );

                // je sauvegarde cette image
                imagejpeg($image400x400, $publicPath . '/small/' . $fileName);

                // je sauvegarde la nouvelle image carrée 
                // file_put_contents($publicPath. 'carré'. $fileName, $imageCarré, FILE_APPEND | LOCK_EX);
                return $this->json(['C\'est bon !'], 200);

                





            }
        }
    }
}
